import React, { useState } from "react";

const ClearAllTodos = () => {
  const [word, setWord] = useState("");

  const inc = () => {
    setWord.className = "text"
  }

  return (
    <div className="text-white text-center text-2xl">
      <span>{word}</span>
      <button onClick={inc}>START</button>
    </div>
  );
};

export default ClearAllTodos;
